import React from 'react';
import './App.css';

function App() {
  return (
    <div className = "box">
      <div className = "container">
      <button className="top">Sign Up</button> 
      <button className="top" >Log In</button> <br />
      <form>
      <h1>Sign Up for Free</h1> 
      <input className="fullname" placeholder="First Name*"  name="firstname" required></input> 
      <input className="fullname" placeholder="Last Name*" name="lastname" style={{marginLeft:"4%", alignItems}} required></input><br></br>
      <input placeholder="Email Address*" name="email" required></input> <br></br>
      <input placeholder="Set A Password*" name="password" required></input><br></br>
      <button type="submit" className="bottom" style={{marginTop: "20px"}}>GET STARTED</button>
      </form>
      </div>
    </div>
  );
}

export default App;
